f=Jb(f),f=(new r).q("Doodle-like",f),h=(new Ib).d('// download: recurrence-lesson.html\r\n        |// output: html\r\n        |``\x3cpre style\x3d"white-space: pre-wrap;font-family:sans-serif"\x3e\r\n        |@let nex \x3d 3 /* n used in examples */\r\n        |@letrec sum nx \x3d if(nx \x3d\x3d 1) "" + nx else\r\n        |  (sum (nx-1)) + "+" + nx\r\n        |@letrec cumul nx \x3d if(nx \x3d\x3d 0) nx else (nx + cumul (nx - 1))\r\n        |@let [P, n, k, lang] \x3d ["P", "n", "k", "en"]\r\n        |@letrec translations \x3d {\r\n        |  default \x3d \\x. translations.en,\r\n        |  en \x3d {\r\n        |    title \x3d "Proof by induction",\r\n        |    language \x3d "Language",\r\n        |    chooseamong \x3d "choose among",\r\n        |    ifproof \x3d "If we want to prove a proposition %s for any integer %s",\r\n        |    needproof \x3d "we first need to prove that %s holds",\r\n        |    andproof \x3d "and that if we know %s for any given %s, we can obtain %s"\r\n        |  },\r\n        |  fr \x3d {\r\n        |    title \x3d "Preuve par r\u00e9currence",\r\n        |    language \x3d "Langue",\r\n        |    chooseamong \x3d "choisissez parmi",\r\n        |    ifproof \x3d "Si nous voulons prouver une proposition %s pour n\'importe quel entier %s",\r\n        |    needproof \x3d "nous devons d\'abord prouver %s",\r\n        |    andproof \x3d "et que si nous savons %s pour n\'importe quel %s donn\u00e9, nous pouvons prouver %s"\r\n        |  }\r\n        |}\r\n        |@letrec langs \x3d (keysOf translations) match {\r\n        |  case [head] ++ tail \x3d\x3e join tail ","\r\n        |}\r\n        |@letrec format s args \x3d args match {\r\n        |  case [] \x3d\x3e s\r\n        |  case [head] ++ tail \x3d\x3e format (replaceFirstIn "%s" s head) tail\r\n        |}\r\n        |@let tr \x3d translations lang\r\n        |@let tag \x3d { default\x3d\\x.\\y. "\x3c" + x + "\x3e" + y + "\x3c/" + x + "\x3e" }\r\n        |@let h1 \x3d tag.h1\r\n        |@let i \x3d tag.i\r\n        |@let b \x3d tag.b\r\n        |(@tr.language \x3d @lang -- @tr.chooseamong @langs)\r\n        |@h1{@tr.title@}\r\n        |A @i{proof by induction@} makes use of @i{the axiom of recurrence@}.\r\n        |The axiom of recurrence states that, for a proposition @P depending on an integer @n, if the following precondition is satisfied:\r\n        |\r\n        |    @P(1)   \u2227   \u2200@n\u2a7e1. @P(@n) \u21d2 @P(@n+1)\r\n        |\r\n        |then the following result holds:\r\n        |\r\n        |    \u2200@n\u2a7e1. @P(@n)\r\n        |\r\n        |@(format tr.ifproof [(P + "(" + n + ")"),n]), @(format tr.needproof [P+"(1)"]), @(format tr.andproof [P+"(" + k+")", k, P+"("+k+"+1)"]).\r\n        |\r\n        |A simple application of proof by induction is to prove that the sum of numbers between 1 and @n is equal to @n*(@n+1)/2.\r\n        |This can be conjectured for particular number, for example @n\x3d@nex (you can change this number): the sum of numbers between 1 and @nex is @(sum nex) \x3d @(cumul nex).\r\n        |On the other side @nex*(@nex+1)/2 \x3d @nex*@(nex + !1)/2 \x3d @(nex*(nex+ !1))/2 \x3d @(nex*(nex+ !1)/ !2). Hence @P(@nex) holds.\r\n        |\r\n        |Now let us prove this result by recurrence.\r\n        |\x3cul\x3e\x3cli\x3eThe proposition @P(1) is trivially true.\x3c/li\x3e\x3cli\x3eGiven an integer @k, suppose that @P(@k) is true, that is, 1+\u2026+@k \x3d @k(@k+1)/2. Adding @k+1 to both sides gives: 1+\u2026+@k+(@k+1) \x3d @k(@k+1)/2 + @k+1 \x3d (@k+1)@k/2 + (@k+1)*2/2 \x3d (@k+1)(@k+2)/2. So we proved @P(@k+1).\x3c/li\x3e\x3c/ul\x3e\r\n        |By recurrence, we prove that @P(@n) is true for all @n.\r\n        |\r\n        |There are many variants of proof by induction: induction basis equal to 2, prefix induction, induction on multiple counters, infinite descent\x3c/pre\x3e``'),
